from Crypto.Util.number import *
from secret import flag

flag = b'flag{*********}'

m = bytes_to_long(flag)
p = getPrime(1024)
q = getPrime(1024)
n = p * q
e = 114
c = pow(m,e,n)

print(c)
print(p >> 200)
print(p & (2 ** 200 - 1))
print(n)

